    "SecondFurther" : MessageLookupByLibrary.simpleMessage("Bien que émotionnellement difficile pour les parents, le processus est très simple et apporte de nombreux avantages tant pour les bébés que pour les parents. Une fois que le bébé a appris à s\'auto-apaiser et à se rendormir seul, il dort plus longtemps, plus profondément et est plus reposé au réveil. Pour les parents, ils n\'ont plus à se réveiller plusieurs fois au milieu de la nuit pour bercer ou chanter le bébé pour le rendormir - l\'auto-apaisement leur apprend à retourner au sommeil par eux-mêmes s\'ils se réveillent au milieu de la nuit. La méthode Ferber peut être très difficile pour certains parents, et une forte détermination est nécessaire pour en tirer les bénéfices. Faites confiance en vous-même et en vos instincts, cela vous aidera beaucoup. Si vous réussissez avec la méthode, vous et votre bébé dormirez mieux."),
