    "SixthFurther" : MessageLookupByLibrary.simpleMessage("Après la routine du coucher, assurez-vous de commencer l\'entraînement uniquement lorsque le bébé est somnolent mais éveillé. Assurez-vous que le bébé est dans un environnement sûr, et vous pouvez entendre le bébé pleurer depuis l\'extérieur de la pièce. Si vous avez un babyphone, assurez-vous de pouvoir voir le bébé. Mais un babyphone n\'est pas essentiel pour l\'entraînement au sommeil. Chaque bébé est différent et spécial à sa manière. La plupart mettent de 3 à 7 jours pour apprendre à s\'auto-apaiser, tandis que d\'autres mettent plus de temps. Les pleurs et le temps mis pour s\'endormir diminueront de manière notable plus rapidement au fil des jours. Un parent reconnaissant nous a dit que leur bébé avait pleuré pendant un total de 16 minutes le premier jour, suivi de 8 minutes le lendemain, 6 minutes le jour suivant, et s\'était endormi en 3 minutes le quatrième jour."),
